import React from 'react';
import styled from 'styled-components';

const Btn = styled.button`
    width: 100%;
    height: 50px;
    background: #999999;
    border: none;
    border-radius: 10px;
    font-size: 18px;
    :hover {
        background-color: white;
    }
`

const Button = ({name}) => {
    return <Btn>{name}</Btn>
};

export default Button;
